import React, { Component } from "react";
import { Button, Input } from "antd";
import "antd/dist/antd.css";
import "../App.css";

import Todos from "./todos";
class Form extends Component {
  render() {
    return (
      <div className="App">
        <Input
          placeholder="Basic usage"
          size="middle"
          style={{ width: "300px" }}
        />
        <Button type="primary">add</Button>

        <div
          className="App"
          style={{
            height: "200px",
            fontWeight: "bold",
            fontFamily: "Italic",
            textAlign: "center",
            border: "red"
          }}
        >
          <Todos />
        </div>
      </div>
    );
  }
}

export default Form;
